package com.webweeb.backend.dto;import lombok.*;import java.util.UUID;/** * LoginHistoryDTO is a Data Transfer Object that represents the login history of a user. * It contains information about the user's login session, including the user's ID, * IP address, user agent, device type, device name, operating system name and version, * browser name and version, and location. */@Getter@Setter@NoArgsConstructor@AllArgsConstructor@Builder@ToStringpublic class LoginHistoryDTO extends BaseDTO{    private UUID userId;    private String ipAddress;    private String userAgent;    private String deviceType;    private String deviceName;    private String osName;    private String osVersion;    private String browserName;    private String browserVersion;    private String location;}